          type: user
        html: '<p>hi guys,<br>State_dict errors can be patched if you got some merged
          models from the web<br>It''s related to auto1111 merge that used to break
          stuffs while converting to diffusers (prior step to coreML conversion)</p>

          <p>You can patch your ckpt using auto1111 checkpoint merger :</p>

          <p>A) Base SD (1.5prunedemaonly?)<br>B) Your buggy model .ckpt</p>

          <ul>

          <li>Drag the merge slider to 0.99 (towards your modelB, 0.99 not 1.00 --
          or it will not add to modelA.)</li>

          <li>Merge</li>

          </ul>

          <p>Now you can convert the resulting .ckpt to CoreML<br>Enjoy</p>

          '
        raw: "hi guys, \nState_dict errors can be patched if you got some merged models\
          \ from the web\nIt's related to auto1111 merge that used to break stuffs\
          \ while converting to diffusers (prior step to coreML conversion)\n\nYou\
          \ can patch your ckpt using auto1111 checkpoint merger :\n\nA) Base SD (1.5prunedemaonly?)\n\
          B) Your buggy model .ckpt\n\n- Drag the merge slider to 0.99 (towards your\
          \ modelB, 0.99 not 1.00 -- or it will not add to modelA.)\n- Merge \n\n\
          Now you can convert the resulting .ckpt to CoreML\nEnjoy"
